import React from "react";
import "./App.css";

function hello() {
  debugger;
  alert("Hello Alex");
}

function App() {
  console.log("App rendering");

  return (
    <div>
      <AppTitle />
      <Rating />
      <Accordion />
      <Rating />
    </div>
  );
}

function AppTitle() {
  return <>This is App component</>;
}

function Rating() {
  console.log("Rating rendering");
  return (
    <>
      <Star />
      <Star />
      <Star />
      <Star />
      <Star />
    </>
  );
}

function Accordion() {
  console.log("Accordion rendering");
  return (
    <>
      <h3>Menu</h3>
      <ul>
        <li>1</li>
        <li>2</li>
        <li>3</li>
      </ul>
    </>
  );
}

function Star() {
  console.log("Star rendering");
  return <div>star</div>;
}

export default App;
